•••••••••••
Stuttgart, a capital de Baden-Württemberg, no sul da Alemanha, fica numa bacia cercada por pomares e colinas florestadas. No fundo do vale corre o rio Neckar e na parte mais antiga da cidade, no entanto, edifícios históricos e casas modernas sobem suavemente as encostas circundantes.
Stuttgart não é, no entanto, um destino turístico popular, embora mantenha um charme elegante e se tenha tornado recentemente uma cidade cosmopolita e animada, cheia de museus e eventos culturais.
